import './App.css';

const App = () => {
  return (
    <div className="App">
      <p>
        به مجموعه ای از یک الفبای کامل و هم خانواده
      </p>
      <h3>
        سامانه مدیریت مخاطبین
      </h3>
      <button className='btn btn-primary'>Button</button>
      <span className='fa fa-user' />
    </div>
  );
}

export default App;
